	(11, 5, 'W1', 'I1NwxVfqnBWgswYchBdsOIz0p8rJugO0bv76ddP5.png', 'Modern Body Care', 9990, 'Discover the many relaxation rituals available. Indulge in aromatherapy sessions, spas, massages or even a full body treatment. Whichever your choice may be, our experiences are guaranteed to bring peace and serenity, perfect for anyone looking to recharge their body, mind and soul.\nTake your pick! Choose ONE from our vast selection of experiences.\n', 'https://issuu.com/blissboxpteltd/docs/blissbox_textblock_06092017_final?e=31300057/53935415', 0, 1, NULL, '2017-12-08 17:16:20', '2017-12-08 17:16:20', 0),
	(12, 5, 'W2', '7owhQBYqEInAh1ezmCTKCDxIDBi7y3Ffq0TaqYVT.png', 'Mental Decompression Kit', 4990, 'Discover the many relaxation rituals available. Indulge in aromatherapy sessions, spas, massages or even a full body treatment. Whichever your choice may be, our experiences are guaranteed to bring peace and serenity, perfect for anyone looking to recharge their body, mind and soul.\nTake your pick! Choose ONE from our vast selection of experiences.\n', 'https://issuu.com/blissboxpteltd/docs/blissbox_textblock_06092017_final?e=31300057/53935415', 0, 1, NULL, '2017-12-08 17:19:27', '2017-12-08 17:19:27', 0),
	(14, 3, 'A1', 'DLbzqPkd3p84c2uJjLGNCoFxMU5NG7TOiXIAj0bF.png', 'Crack Your Limits', 4990, 'For fans of thrills or the adventurous amongst us - Get your adrenaline pumping with some out-of-the-ordinary adventures: wakeboarding, parkour, dance or even just taking up a new hobby! Stretch your comfort zone - your next adventure awaits! \nTake your pick! Choose ONE from our vast selection of experiences.\n', 'https://issuu.com/blissboxpteltd/docs/blissbox_textblock_06092017_final?e=31300057/53935415', 0, 1, NULL, '2017-12-11 09:12:37', '2017-12-11 09:12:37', 0),
	(15, 3, 'A3', 'SSANb6LZm2KZ4dC1h8SpcdGgmXcoRw5WXPxkykPP.png', 'Widen Your Energy', 15990, 'For fans of thrills or the adventurous amongst us - Get your adrenaline pumping with some out-of-the-ordinary adventures: wakeboarding, parkour, dance or even just taking up a new hobby! Stretch your comfort zone - your next adventure awaits! \nTake your pick! Choose ONE from our vast selection of experiences.\n', 'https://issuu.com/blissboxpteltd/docs/blissbox_textblock_06092017_final?e=31300057/53935415', 0, 1, NULL, '2017-12-11 09:15:51', '2017-12-11 09:15:51', 0),
	(19, 4, 'H1', 'q94b2AmDlQyaY68qkXwuIzoA0C03hJHuzqIP5BK5.png', 'Insipire Gateway', 12990, 'Find a home away from home in our top-rated heritage gems in Singapore. Be it exotic and charming or authentic and unusual  - everyone deserves a break!\r\nTake your pick! Choose ONE from our vast selection of experiences.', 'https://issuu.com/blissboxpteltd/docs/blissbox_escape__129.90?e=31300057/56361075', 0, 1, NULL, '2017-12-14 17:55:26', '2017-12-14 17:55:26', 0),
	(21, 4, 'H2', 'fwb9w5NTp48R69Mu5WoCEruy1mSuUAoONKOdpFXV.png', 'Pleasant Heaven', 19990, 'Find a home away from home in our top-rated heritage gems in Singapore. Be it exotic and charming or authentic and unusual  - everyone deserves a break!\r\nTake your pick! Choose ONE from our vast selection of experiences.', 'https://issuu.com/blissboxpteltd/docs/blissbox_escape__199.90?e=31300057/56373394', 0, 1, NULL, '2017-12-14 17:56:06', '2017-12-14 17:56:06', 0),
	(23, 1, '14', 'TAStiDpeWTmJsRpxJ558pMGQZXoaLJa26IfugYrJ.png', 'Love Letter', 9990, 'The perfect box for 2. Our special valentine\'s day collection suites lovebirds of all kinds.\r\n\r\nOur love recipe includes:\r\n\r\n- 2 giant cuts of candlelight dinners\r\n\r\n- 1 cup of energising powder\r\n\r\n- 2 tablespoon of zen pleasure\r\n\r\n- 2 tablespoon of laughter', NULL, NULL, NULL, NULL, '2018-01-29 12:18:25', '2018-01-29 12:18:25', NULL);
