INSERT INTO `universes` (`id`, `initial`, `thumbnail`, `name`, `description`, `deleted_at`, `created_at`, `updated_at`) VALUES
	(1, 'LT', 'X7qGhDBle3cXkfCqVVltf9dOwryYFQgzzn31QxQQ.png', 'Multitheme', 'With Blissbox, YOU choose.  Our multi-themed box allows you a taste of whichever theme you like. Select from our handpicked selection - feel like an adventurous thrill? Wine and dine at a great chef’s table? Or indulge in a modern spa escape? This magical gift box brings together the best of our experiences to live!', NULL, '2017-10-27 01:29:10', '2017-10-27 01:29:10'),
	(2, 'ST', 'qzJI2cwIPZBi6ks9kVqEqPvmclfGm661vZm1HEQT.png', 'Indulge', 'Awaken your taste buds and tantalize your senses with our extensive array of sensory delights! Enjoy anything from a surprising tasting session, intriguing cocktails, delectable brunches or even a candlelight dinner for two against the beautiful backdrop of Singapore’s nightlife.', NULL, '2017-10-29 23:10:52', '2017-10-29 23:11:35'),
	(3, 'DV', 'gckBHpZV81hBbQEzX8XBX2zJRHtVbAofhgetYHlL.png', 'Energize', 'For fans of thrills or the adventurous amongst us - Get your adrenaline pumping with some out-of-the-ordinary adventures: wakeboarding, parkour, dance or even just taking up a new hobby! Stretch your comfort zone - your next adventure awaits! ', NULL, '2017-10-29 23:13:08', '2017-10-29 23:13:08'),
	(4, 'TA', '5HxFSlPkAA5UP3rEyM46nk34JhQEWpL5q6cPWOjF.png', 'Escape', 'Find a home away from home in our top-rated heritage gems in Singapore. Be it exotic and charming or authentic and unusual  - everyone deserves a break!', NULL, '2017-10-29 23:13:45', '2017-10-29 23:13:45'),
	(5, 'LL', 'Fx1EKwI7V4a5fdOkvhivPdkP4Y0xVw30qavGDSCn.png', 'Relax', 'Discover the many relaxation rituals available. Indulge in aromatherapy sessions, spas, massages or even a full body treatment. Whichever your choice may be, our experiences are guaranteed to bring peace and serenity, perfect for anyone looking to recharge their body, mind and soul.spa days, thalasso, hammam, massages, facial and body treatments ... So many activities that will bring you relaxation and calm. Discover relaxation rituals that will give you feelings of peace and serenity, to recharge your body and mind.', NULL, '2017-10-29 23:14:08', '2017-10-29 23:14:08');
